/** 
 * Runs  {@code callable} concurrently {@code numberOfThreads} times. 
 */
@GwtIncompatible private void runConcurrentTest(int numberOfThreads,final Callable<Void> callable) throws Exception {
  ExecutorService executorService=Executors.newFixedThreadPool(numberOfThreads);
  final CountDownLatch startLatch=new CountDownLatch(numberOfThreads);
  final CountDownLatch doneLatch=new CountDownLatch(numberOfThreads);
  for (int i=numberOfThreads; i > 0; i--) {
    @SuppressWarnings("unused") Future<?> possiblyIgnoredError=executorService.submit(new Callable<Void>(){
      @Override public Void call() throws Exception {
        startLatch.countDown();
        startLatch.await();
        callable.call();
        doneLatch.countDown();
        return null;
      }
    }
);
  }
  doneLatch.await();
}
